webpackJsonp([0x5d4015666993],{4962:function(t,e){t.exports={data:{post:{html:'<p>Still no word from VA Linux. A note on slashdot says to be patient. So I am. I tried calling, but the helpful folks couldn\'t find my name on any list.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/1999/12/scottfon.jpg" height="206" width="300" border="0" alt="scottfon.jpg: Scott phoning home" /></p>\n<p>Mama took a quiet day today. Her childbirth class had their final session here at our house last night. The 5 are all in Week 36 or better, and even the midwife is pregnant. </p>\n<p>Thanks to Userland for implementing the "multiple days on the home page" feature in Manila! That\'s a main feature of a squishdot site that can now be done in Manila by changing just one preference.</p>',fields:{title:"Friday misc...",date:"10 Dec 1999",url:"https://papascott.de/1999-12-10-friday-misc/"}}},pathContext:{slug:"/1999-12-10-friday-misc/",prev:{fields:{title:"Linux fever...",date:"09 Dec 1999",slug:"/1999-12-09-linux-fever/"}},next:{fields:{title:"Christmas cards....",date:"11 Dec 1999",slug:"/1999-12-11-christmas-cards/"}}}}}});
